import Button from "../../Button";

const Learn_Overall = ({ title, image, orderLink, light = false }) => {
  return (
    <section className="padding grid lg:grid-cols-2 gap-5">
      <div className={`lg:w-1/2 ${light && "text-slate-50"}`}>
        <h2>{title}</h2>
        <p>Design yours or get a trade-in estimate for your current vehicle.</p>
        <div className="">
          <Button
            to={orderLink}
            label="Custom Order"
            outline={light ? "dark" : light}
          />
        </div>
      </div>
      <div className="lg:w-1/2">
        <img src={image} alt={title} />
      </div>
    </section>
  );
};

export default Learn_Overall;
